import { Component } from "@angular/core";
import { RouterOutlet } from "@angular/router";
import { ButtonComponent } from "./components/button/button.component";

@Component({
  selector: "app-root",
  standalone: true,
  imports: [RouterOutlet, ButtonComponent],
  templateUrl: "./app.component.html",
  styleUrl: "./app.component.scss",
})
export class AppComponent {
  title = "angular-xui";
}

import { Component, Input, Output, EventEmitter } from "@angular/core";
import { CommonModule } from "@angular/common";
import { cva } from "class-variance-authority";

const buttonVariants = cva("px-4 py-2 rounded-md", {
  variants: {
    variant: {
      primary: "bg-blue-600 text-white hover:bg-blue-700",
      secondary: "bg-gray-600 text-white hover:bg-gray-700",
      outline:
        "border border-blue-600 text-blue-600 hover:bg-blue-600 hover:text-white",
      danger: "bg-red-600 text-white hover:bg-red-700",
    },
    size: {
      small: "text-sm",
      medium: "text-base",
      large: "text-lg",
    },
  },
  defaultVariants: {
    variant: "primary",
    size: "medium",
  },
});

@Component({
  selector: "app-button",
  standalone: true,
  imports: [CommonModule],
  template: `
    <button
      [class]="buttonClasses"
      [disabled]="disabled"
      (click)="handleClick()"
    >
      <span class="flex items-center gap-2">
        <span *ngIf="iconLeft" class="icon-left">{{ iconLeft }}</span>
        <ng-content></ng-content>
        <span *ngIf="iconRight" class="icon-right">{{ iconRight }}</span>
      </span>
    </button>
  `,
})
export class ButtonComponent {
  @Input() variant: "primary" | "secondary" | "outline" | "danger" = "primary";
  @Input() size: "small" | "medium" | "large" = "medium";
  @Input() disabled: boolean = false;
  @Input() iconLeft?: string;
  @Input() iconRight?: string;
  @Output() clicked = new EventEmitter<void>();

  get buttonClasses(): string {
    return buttonVariants({ variant: this.variant, size: this.size });
  }

  handleClick() {
    this.clicked.emit();
  }
}

import { Component, Input } from "@angular/core";
import { CommonModule } from "@angular/common";

@Component({
  selector: "app-typography",
  standalone: true,
  imports: [CommonModule],
  template: `
    <div [class]="classes">
      {{ text }}
    </div>
  `,
})
export class TypographyComponent {
  @Input() variant:
    | "h1"
    | "h2"
    | "h3"
    | "h4"
    | "subtitle1"
    | "subtitle2"
    | "body1"
    | "body2"
    | "caption" = "body1";
  @Input() text: string = "";

  get classes(): string {
    const variantClasses = {
      h1: "text-5xl font-bold text-gray-900 leading-tight",
      h2: "text-4xl font-semibold text-gray-900 leading-tight",
      h3: "text-3xl font-semibold text-gray-900 leading-snug",
      h4: "text-2xl font-medium text-gray-900 leading-snug",
      subtitle1: "text-xl font-medium text-gray-800 leading-relaxed",
      subtitle2: "text-lg font-medium text-gray-800 leading-relaxed",
      body1: "text-base text-gray-700 leading-relaxed",
      body2: "text-sm text-gray-700 leading-relaxed",
      caption: "text-xs text-gray-600 leading-normal",
    };

    return variantClasses[this.variant];
  }
}

